pragma solidity ^0.8.14;

contract Condition {
    uint256 public number = 100;

    function example(uint256 _x) public view returns(bool) {
        return (_x < 10);
    }

    function addNumber(uint256 _x) public {
        if (_x < 10)
            number += _x;
        else
            revert();
    }

    function addNumber2(uint256 _x) public {
        require(_x < 10);
        if (_x < 10)
            number += _x;
        else
            revert();
    }
}

